import './Tab3.css'
import * as React from 'react';
import Checkbox from '@mui/material/Checkbox';
import TextField from '@mui/material/TextField';
import Autocomplete from '@mui/material/Autocomplete';
import CheckBoxOutlineBlankIcon from '@mui/icons-material/CheckBoxOutlineBlank';
import CheckBoxIcon from '@mui/icons-material/CheckBox';
import {Table} from '../../components/table/table';
import Button from '@mui/material/Button';
import Accordion from '@mui/material/Accordion';
import AccordionDetails from '@mui/material/AccordionDetails';
import { Context } from '../../controller/info';
import {useNavigate} from 'react-router-dom';

const icon = <CheckBoxOutlineBlankIcon fontSize="small" />;
const checkedIcon = <CheckBoxIcon fontSize="small" />;

export default function Tab3() {
  const navigate = useNavigate()
  const user = React.useContext(Context)

  const default_colleges = ['Aollege 1','College 2','Bollege 3','Aollege 4']
  const main = ['Main Ranking 1','Main Ranking 2'];
  const add = ['Additional Ranking 1', 'Additional Ranking 2'];

  const [expandedStep1, setExpandedStep1] = React.useState(true);
  const [expandedStep2, setExpandedStep2] = React.useState(false);
  const handleNextStep = () => {
    setExpandedStep1(false);
    setExpandedStep2(true);
  };

  const handlePreviousStep = () => {
    setExpandedStep1(true);
    setExpandedStep2(false);
  }

  const [colleges,setColleges] = React.useState([])
  const [mainRanking,setMainRanking] = React.useState('')
  const [additionalRanking,setAdditionalRanking] = React.useState('')
  const [weight,setWeight] = React.useState(-1)

    return (
      <>
        <h1>Welcome to Tab 3.</h1> 
        <section id = "tab3">

        <Accordion expanded={expandedStep1}>
          <div className = 'buttons'>
            <div className = 'title'>Step 1: Schools Selection</div>
            <div className = "search">
                <Button variant="contained" sx={{ width: 150 }} onClick = {() => {
                  if (colleges.length < 2){
                    alert('Please Select At Least 2 Colleges To Compare.')
                    return
                  }
                  handleNextStep()
                }}>
                  Next Step
                </Button>
            </div>
          </div>
          <AccordionDetails>
            <Autocomplete
              multiple
              id="checkboxes-tags-demo"
              options={default_colleges.sort((a,b)=> -b.localeCompare(a))}
              groupBy={(option) => option[0]}
              disableCloseOnSelect
              getOptionLabel={(option) => option}
              renderOption={(props, option, { selected }) => (
                <li {...props}>
                  <Checkbox
                    icon={icon}
                    checkedIcon={checkedIcon}
                    style={{ marginRight: 8 }}
                    checked={selected}
                  />
                  {option}
                </li>
              )}
              renderInput={(params) => (
                <TextField {...params} label="Search for Colleges To Compare" placeholder="College" />
              )}
              onChange={(event, value) => {
                setColleges(value)
              }}
            />
          </AccordionDetails>
        </Accordion>

        <Accordion expanded={expandedStep2}>
          <div className ="buttons">
            <div className='title'> Step 2: Select Rankings</div>
            <div className ="search">
              <Button variant="contained" sx={{ width: 150 }} onClick = {() => {
                handlePreviousStep()
              }}>
                Previous Step
              </Button>
            </div> 
          </div>
          <AccordionDetails>
            <div className='container'>
              <Autocomplete
                disablePortal
                id="combo-box-demo"
                className='tab'
                options={main}
                renderInput={(params) => <TextField {...params} label="Choose Main Ranking" />}
                onChange = {(e,value)=> setMainRanking(value)}
              />
              <Autocomplete
                disablePortal
                id="combo-box-demo"
                className = 'tab'
                options={add}
                renderInput={(params) => <TextField {...params} label="Choose Additional Ranking (Optional)" />}
                onChange = {(e,value) => setAdditionalRanking(value)}
              />
              <TextField id="outlined-basic" label="Weight (0 to 1)"  variant="outlined"
                onChange = {e => setWeight(parseFloat(e.target.value))} />
              <div className = "search">
                <Button variant="contained" sx={{ width: 300 }}
                  onClick = {() => {
                    if (mainRanking === null || mainRanking.length === 0) {
                      alert('Please Select Main Ranking.')
                      return
                    }
                    if (isNaN(weight) || (weight < 0 || weight > 1)){
                      alert('Please Provide Appropriate Weight (From 0 to 1).')
                      return
                    }
                    const currentUser = JSON.parse(window.localStorage.getItem("data"))
                    currentUser.push({
                      main : mainRanking,
                      add : additionalRanking,
                      weight : weight
                    })
                    window.localStorage.setItem("data", JSON.stringify(currentUser))
                    user.updateData(currentUser)
                  }}>
                    Add
                  </Button>
              </div>
            </div>
            <Table></Table>
          </AccordionDetails>
        </Accordion>    

        <div className ='search'>
          <Button variant="contained" color="error" sx={{ width: 300, fontWeight: 900, fontSize : 17 }} onClick = {() => {
            if (colleges.length < 2){
              alert('Please Select At Least 2 Colleges To Compare.')
              return
            }
            if (JSON.parse(window.localStorage.getItem("data")).length === 0){
              alert('Please Select Ranking Criteria.')
              return
            }
            window.localStorage.setItem("colleges",JSON.stringify(colleges))
            navigate('../Tab4',{relative: "path"})
          }}>
            Compare
          </Button>
        </div>

        </section>
      </>
    );
}
